import React from 'react';
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { RootState } from '../../store';

const CandidateDashboard: React.FC = () => {
  const { user } = useSelector((state: RootState) => state.auth);

  // Mock data for dashboard
  const dashboardStats = {
    applications: 3,
    interviews: 1,
    assessments: 2,
    profileStrength: 85
  };

  const recentApplications = [
    {
      id: '1',
      jobTitle: 'Senior Frontend Developer',
      company: 'TechCorp Inc',
      status: 'Under Review',
      date: '2024-01-15',
      statusColor: 'bg-blue-100 text-blue-800'
    },
    {
      id: '2',
      jobTitle: 'Full Stack Engineer',
      company: 'StartupXYZ',
      status: 'Interview Scheduled',
      date: '2024-01-12',
      statusColor: 'bg-green-100 text-green-800'
    },
    {
      id: '3',
      jobTitle: 'UI/UX Designer',
      company: 'DesignStudio',
      status: 'Assessment',
      date: '2024-01-10',
      statusColor: 'bg-purple-100 text-purple-800'
    }
  ];

  const recommendedJobs = [
    {
      id: '4',
      title: 'React Developer',
      company: 'WebTech Solutions',
      location: 'Remote',
      salary: '$90,000 - $120,000',
      tags: ['React', 'TypeScript', 'Frontend']
    },
    {
      id: '5',
      title: 'Backend Engineer',
      company: 'DataSystems',
      location: 'New York, NY',
      salary: '$110,000 - $140,000',
      tags: ['Node.js', 'Python', 'AWS']
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-blue-50/30">
      <div className="w-full px-4 sm:px-6 lg:px-8 py-8">
        {/* Welcome Header */}
        <div className="text-center mb-12">
          <div className="flex items-center justify-center space-x-4 mb-6">
            <div className="w-16 h-16 bg-gradient-to-r from-blue-500 to-purple-500 rounded-full flex items-center justify-center text-white font-bold text-xl">
              {user?.name?.charAt(0) || 'C'}
            </div>
            <div className="text-left">
              <h1 className="text-4xl font-bold bg-gradient-to-r from-gray-900 to-gray-700 bg-clip-text text-transparent">
                Welcome back, {user?.name}!
              </h1>
              <p className="text-lg text-gray-600 mt-2">
                Ready to find your next career opportunity?
              </p>
            </div>
          </div>
        </div>

        {/* Stats Grid */}
        <div className="grid grid-cols-1 gap-6 mb-12 sm:grid-cols-2 lg:grid-cols-4">
          {/* ... stats cards remain the same ... */}
        </div>

        <div className="grid grid-cols-1 gap-8 lg:grid-cols-2">
          {/* Quick Actions */}
          <div className="space-y-6">
            <h2 className="text-2xl font-bold text-gray-900">Quick Actions</h2>
            
            <div className="grid grid-cols-1 gap-4 sm:grid-cols-2">
              {/* ... quick action cards remain the same ... */}
            </div>
          </div>

          {/* Recent Applications & Recommended Jobs */}
          <div className="space-y-6">
            <div className="flex items-center justify-between">
              <h2 className="text-2xl font-bold text-gray-900">Recent Applications</h2>
              <Link to="/applications" className="text-blue-600 hover:text-blue-700 font-medium text-sm">
                View All
              </Link>
            </div>
            
            <div className="bg-white/80 backdrop-blur-sm rounded-2xl border border-white/20 shadow-soft">
              {recentApplications.map((application) => (
                <div key={application.id} className="p-6 border-b border-gray-200/60 last:border-b-0">
                  <div className="flex items-center justify-between">
                    <div className="flex-1 min-w-0"> {/* Added min-w-0 */}
                      <h3 className="font-semibold text-gray-900 truncate">{application.jobTitle}</h3>
                      <p className="text-gray-600 text-sm truncate">{application.company}</p>
                    </div>
                    <span className={`inline-flex items-center px-3 py-1 rounded-full text-xs font-medium ${application.statusColor} flex-shrink-0 ml-4`}>
                      {application.status}
                    </span>
                  </div>
                  <div className="mt-2 flex items-center text-sm text-gray-500">
                    <svg className="w-4 h-4 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7V3m8 4V3m-9 8h10M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z" />
                    </svg>
                    Applied {new Date(application.date).toLocaleDateString()}
                  </div>
                </div>
              ))}
            </div>

            {/* Recommended Jobs */}
            <div>
              <h2 className="text-2xl font-bold text-gray-900 mb-4">Recommended for You</h2>
              <div className="space-y-4">
                {recommendedJobs.map((job) => (
                  <div key={job.id} className="bg-white/80 backdrop-blur-sm rounded-2xl p-4 border border-white/20 shadow-soft hover:shadow-glow transition-all duration-300">
                    <div className="flex items-center justify-between">
                      <div className="flex-1 min-w-0"> {/* Added min-w-0 */}
                        <h3 className="font-semibold text-gray-900 truncate">{job.title}</h3>
                        <p className="text-gray-600 text-sm truncate">{job.company} â€¢ {job.location}</p>
                        <p className="text-green-600 text-sm font-medium mt-1">{job.salary}</p>
                      </div>
                      <Link
                        to={`/application/${job.id}`}
                        className="px-4 py-2 text-sm font-medium text-white bg-gradient-to-r from-blue-600 to-purple-600 rounded-lg hover:from-blue-700 hover:to-purple-700 transition-all duration-200 flex-shrink-0 ml-4"
                      >
                        Apply
                      </Link>
                    </div>
                    <div className="mt-2 flex flex-wrap gap-1">
                      {job.tags.map((tag, index) => (
                        <span key={index} className="inline-flex items-center px-2 py-1 rounded text-xs font-medium bg-blue-100 text-blue-800">
                          {tag}
                        </span>
                      ))}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CandidateDashboard;
